CREATE DATABASE IF NOT EXISTS ugram;
USE ugram;


CREATE TABLE IF NOT EXISTS users
(
    userId smallint AUTO_INCREMENT NOT NULL,
    userName varchar(255) NOT NULL, 
    email varchar(255) NOT NULL,
	lastName varchar(255) NOT NULL,
    firstName varchar(255) NOT NULL,
    phone varchar(20),
    profilePicURL varchar(255),
	updatedAt date,
    createdAt date,

	PRIMARY KEY (userId),
    CONSTRAINT user_name UNIQUE (userName),
    CONSTRAINT user_email UNIQUE (email)
);


CREATE TABLE IF NOT EXISTS images
(
    imageId smallint AUTO_INCREMENT NOT NULL,
    userId smallint NOT NULL,
    imageUrl varchar(255) NOT NULL,
    descript text,
    updatedAt date,
    createdAt date,
	
	PRIMARY KEY (imageId),
	FOREIGN KEY (userId) REFERENCES users(userId) ON DELETE CASCADE
);


CREATE TABLE IF NOT EXISTS hashtags
(
    hashtagId smallint AUTO_INCREMENT NOT NULL,
    imageId smallint NOT NULL,
    tag varchar(255) NOT NULL,
	updatedAt date,
    createdAt date,
	
	PRIMARY KEY (hashtagId),
	FOREIGN KEY (imageId) REFERENCES images(imageId) ON DELETE CASCADE
);


CREATE TABLE IF NOT EXISTS mentions
(
    mentionId smallint AUTO_INCREMENT NOT NULL,
    imageId smallint NOT NULL,
    userName varchar(255) NOT NULL,
	updatedAt date,
    createdAt date,
	
	PRIMARY KEY (mentionID),
	FOREIGN KEY (imageId) REFERENCES images(imageId) ON DELETE CASCADE
);



